import React, {Component} from 'react';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogTitle from '@material-ui/core/DialogTitle';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogActions from '@material-ui/core/DialogActions';

class PrWarmup extends Component {
    render() { 
        return ( 
        <div style="textAlign: 'center'">
        
        <h4>PR Warmup Planner</h4>

        <form noValidate autoComplete="off">
        <TextField type="number" id="goalPR" label="Enter goal PR" variant="outlined" 
        margin="dense" required="True" size="medium"/>
        </form>


        <Button variant="contained" color="primary">
        Calculate
        </Button>

        <Dialog>
        <DialogTitle>Warmup Sets</DialogTitle>
        <DialogContent>
          <DialogContentText>
            Your results are...
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button color="primary">
            Done
          </Button>
        </DialogActions>
        </Dialog>
        </div> );
    }
}
 
export default PrWarmup;
